import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Card = (props) => {
    return (
        <>
            <h1>{props.book.title}</h1>
            <p>{props.book.description}</p>
            <small>{props.book.author}</small>
        </>
    )
}

export default Card;
